import React from 'react'
import Input from '../../components/Input/Input'
import Dropdown from '../../components/Dropdown/Dropdown'
import './Origem.css'

class Origem extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            value: 'Default'
        }
    }

    property = (event) => {
        if(event.target.select.value === 'apartamento') {
            console.log('oi')
        } else {
            return ''
        }
    }

    render() {
        return (
            <main>
                <h1>Origem</h1>
                <Input 
                htmlFor='endOrigem'
                id='endOrigem'
                type='text'
                name='origem'>
                Endereço:
                </Input>
                <Dropdown
                htmlFor='propertyType'
                id='propertyType'
                name='propertyType'
                value1='default'
                option1='Escolha o tipo do imóvel'
                value2='apartamento'
                option2='Apartamento'
                value3='casa'
                option3='Casa'>
                Tipo de imóvel:
                </Dropdown>
            </main>
        )
    }
}


export default Origem
